column25:
Sol da manhã; 
 1o pavimento:
 . Sala para 3 ambientes com pé direito duplo;
 . Espaço gourmet coberto aberto em frente à sala de jantar e ao lado da cozinha, equipado com bancada, churrasqueira e armários.
 . Escritório;
 . Lavabo.
 . Garagem para 2 veículos com vagas livres cobertas;
 . Dependência completa de empregada;
 . Despensa;
 . Escada de acesso ao 2o pavimento.
 2o pavimento:
 . Ampla sala íntima (home cinema);
 . 4 quartos, sendo 2 suítes;
 . 2 semi-suítes;Suíte master com closet;
 . 3 quartos com belíssima vista para a lagoa;
 . Salas com piso em granito importado, lareira a gás;
 . Painéis de granito paginado de excelente qualidade;
 . Piscina com borda infinita e vista para a lagoa;
 . Espaço gourmet coberto aberto integrado aos ambientes sociais;
 . Casa com armários em todos os ambientes;
